import { Button, AppBar, Card, CardContent, CircularProgress, Container, Grid, IconButton, makeStyles, Toolbar, Typography, Box } from "@material-ui/core";
import { Alert, AlertTitle } from "@material-ui/lab";
import { useSnackbar } from "notistack";
import { useEffect, useState } from "react";
import { getUserInfo } from "../../services/user.service";
import { Person, Menu as MenuIcon } from "@material-ui/icons";
import authService from "../../services/auth.service";
import { useNavigate } from "react-router-dom";
import {axios} from "axios";

const useStyles = makeStyles((theme) => ({
    root: {
        height: "100%"
    },
    grid: {
        height: "100%"
    },
    logoutBtn: {
        marginLeft: "auto"
    }
}));


export default function HomeView(props) {


    return (
        <Container maxWidth={false} className="App-header">
            <Container maxWidth={"sm"}>
                <Card id="form">
                    <CardHeader title={"Login"}/>
                    <CardContent >
                        <form onSubmit={handleLogin} >

                                    <TextField
                                        variant="outlined"
                                        placeholder={"Username"}
                                        value={username ?? ""}
                                        onChange={e => setUsername(e.target.value)}
                                        fullWidth
                                        className="field"
                                    />
                                    <TextField
                                        variant="outlined"
                                        placeholder={"Password"}
                                        type={"password"}
                                        value={password ?? ""}
                                        onChange={e => setPassword(e.target.value)}
                                        fullWidth
                                        className="field"
                                    />
                                    <Button type="submit" id="loginButton"> Login </Button>
                        </form>
                    </CardContent>
                </Card>
            </Container>
            <div id="logo">
                <img src={logo} width={400} alt="" />
             </div>
        </Container>


    );
}
